  //   }, 5000)
  // }, [])


  return (
    <>
      <div className="App">
    <div className='Icon_Loading'>
      {
         isLoading ? <PacmanLoader  color={"rgba(122, 17, 124, 1)"}
         loading={isLoading}
         size={90}
         />
         :
      <div>
        <Navbar />
        <Header />
        <ListProductHere />
        <Maplocation />
        <ContactUs />
        <Footer />

      </div>
      }
      </div>
    </div>
    </>
  );
}

export default App;
